properties.description:
In zona Baggio MS Immobiliare propone all'asta appartamento di 142 Mq circa in ottimo stato, disposta su tre livelli con cantina al piano interrato, composta da: 
- ampio soggiorno e cucina abitabile con balcone/terrazzino di accesso al giardinetto cortiletto interno privato al piano terra; 
- al primo piano due locali, bagno e balcone; 
- al secondo piano sottotetto un locale con terrazzino; 
I livelli sono collegati da scala interna. Il passaggio pedonale e carraio sono in comunione con altre unità poste nel cortiletto interno; porzione di area cortilizia interclusa privata e delimitata.
